#DumbbellClubShowcase

Candice Lewis @icandyfitbeauty is stepping away from competing to concentrate on starting a family. She’s a 13x Champ & 4x Arnold IFBB Figure Pro winner, plus this years Runner-up in the Ms Figure Olympia, missing the title by only 1 point, so it was an incredible run. She will continue spreading her knowledge and her love for the business. We were to happy to have connected with her @thefitexpo in San Diego and include her in the 2018 Dumbbell Club World Tour with the official custom Dumbbell from @nspirebarbellindia promoting fitness one picture at a time.
